import React from 'react';
import {Card} from 'antd';

const { Meta } = Card;



const Article = (props) => {
    return (
        <Card
        hoverable
        style={{ width: 240 }}
        cover={<img alt="example" src="https://assets.entrepreneur.com/content/3x2/2000/20191219170611-GettyImages-1152794789.jpeg" />}
        >
        <Meta title="Europe Street beat" description="www.instagram.com" />
      </Card>
    );

}

export default Article;
